import React from "react";
import "./style.scss";
import Slider from "../../components/Slider";
import CheckboxHome from "../../components/CheckboxHome";
import CheckboxFilter from "../../components/CheckboxFilter";
import CheckboxCondition from "../../components/CheckboxCondition";
import SelectionEquipment from "../../components/SelectionEquipment";

import { Container, Row, Col } from "react-bootstrap";
function Main() {
  return(
      <Container className="fondo">
          <Row>
            <Col className="a1">
              <CheckboxHome />
            </Col>
            <Col className="a2">1</Col>
            <Col className="a3">1</Col>
            <Col className="a4">
              <SelectionEquipment />
            </Col>
          </Row>
          <Row>
            <Col  className="a1">
              <CheckboxCondition />
            </Col>
            <Col className="a3">
              <Slider />
            </Col>
            <Col className="a2">1</Col>
            <Col className="a4">
              <CheckboxFilter />
            </Col>
          </Row>
      </Container>
  );
}

export default Main;
